import Logo from '../header/Logo.js';

import {
  Switch,
  Route,
  Link,
} from 'react-router-dom';

const HeaderS = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  display: flex;

  width:100%;
  min-width: 1920px;
  height: 60px;
  padding: 1rem;
  font-weight: bold;
  display: flex;
  align-items: center;
  background-color: white;
  border-top: 3px solid black;
  border-bottom: 3px solid black;
`;

function Header({ children }) {

  return <HeaderS>
    <Logo></Logo>
    <Searchbar></Searchbar>
    <NavButton></NavButton>
    <NowLogout></NowLogout>
  </HeaderS>;
}

export default Header;
